CREATE TABLE IF NOT EXISTS EmployeeStatusStage1 (
    EmployeeNumber VARCHAR(20),
    EmployeeFirstName VARCHAR(100),
    EmployeeLastName VARCHAR(100),
    OriginalHireDate DATE,
    MostRecentHireDate DATE,
    RevisedServiceDate DATE,
    EmploymentStatusName VARCHAR(50),
    StatusReasonName VARCHAR(50),
    EmploymentStatusEffectiveStart DATE,
    EmploymentStatusEffectiveEnd DATE,
    BaseRate DECIMAL(10,3),
    TerminationDate DATE,
    KEY idx_empnum (EmployeeNumber),
    KEY idx_effstart (EmploymentStatusEffectiveStart),
    KEY idx_empnum_effstart (EmployeeNumber, EmploymentStatusEffectiveStart)
);

